import { DBDatas } from "types/types";
import st from "./Chapter.module.scss";

interface Prop {
  dbDatas: DBDatas[];
}

const Chapter = ({ dbDatas }: Prop) => {
  return (
    <section className={st.chapter}>
      {dbDatas.map((el, idx) => (
        <>
          {el.title} - {el.chapter}
        </>
      ))}
    </section>
  );
};

export default Chapter;
